import React, { useEffect, useState } from 'react'


const Icons = (props) => {


  const [iconComponent, setIconComponent] = useState(null);
  const x = props.icon; // Set the desired value for x

  useEffect(() => {
    import(`@react-icons/all-files/fa/${x}`).then(module => {
      setIconComponent(module.default);
    });
  }, [x]);

  const componentString  = `<${props.icon} />`
  const icon = React.createElement(React.Fragment, {}, componentString);
  
  return (
    <div>
      <div style={{"--color": props.color}} class="file-icons">{iconComponent && icon}</div>
    </div>
  )
}

export default Icons
